Distribution of NFIs (gas heater, gas cylinders, gas refills, blankets) for winterization.

Assistance is given to 90 HHs and it is composed with the following (per family):
- 1 gas heater;
- 1 gas cylinder;
- 16 gas refills;
- 5 blankets.

